import React, {Component} from 'react';



class EventPeople extends Component {
    
     constructor(props){
        super(props);  
    }

    render(){    
        return(
            <div>
            <button key={this.props.data.people} type="button" className="btn btn-warning btn-eventPeople btn-sm">{this.props.data.people} <button id={this.props.data.people} className="btn btn-warning" onClick={this.props.data.deleteMember}>x</button></button>
            <div>
                <div className="modal" id={JSON.stringify(this.props.data.people)} tabindex="-1" role="dialog" aria-labelledby="editEventLModal" aria-hidden="true">
                <div className="modal-dialog" role="document">
                    <div className="modal-content">
                    <div className="modal-header">
                        {/* <h5 className="modal-title text-dark" id="editEventLModal">Edit {this.props.eventData.event.title}</h5> */}
                        <button type="button" className="close" data-dismiss="modal" aria-label="Close">
                        <span aria-hidden="true">&times;</span>
                        </button>
                    </div>
                    <div className="modal-body text-dark">
                        <form className="form" onSubmit={this.handleSubmit}>
                            <div className="form-group mx-sm-3 mb-2">
                                <input type="text" className="form-control" id={"editEventTitle"+JSON.stringify(this.props.eventData.event._id)} placeholder={"Edit "+"'"+this.props.eventData.event.title+"'" }></input>                      
                            </div>
                        </form> 
                    </div>
                    <div class="modal-footer">
                        <button type="button" className="btn btn-secondary" data-dismiss="modal">Close</button>
                        <button type="button" className="btn btn-primary" onClick={() => this.doFunction()} data-dismiss="modal">Save changes</button>
                        
                    </div>
                    </div>
                </div>
                </div>
            </div>
            </div>

        )
    }
}

export default EventPeople;
